import "./Header.css";
import React from "react";
import Logo from "../Logo/Logo";
import Navigation from "../Navigation/Navigation";

function Header() {
  return (
    <header className="header">
      <div className="header__logo">
        <Logo />
        <h1 className="header__title">СИТИ</h1>
      </div>
    </header>
  );
}

export default Header;
